â 
"I am so sorry for your loss."â 
â 
"Would you like to talk about it?"â 
â 
Both are really simple and easy to remember, and will show the grieving person that you truly care. On the flip side, here are some things you should NOT say:â 
â 
â€œI know how you feel."â 
â 
"Are you okay?"â 
â 
â€œEverything happens for a reason.â€â 
â 
First off, no, you don't know how they feel. Everyone grieves differently so there really isn't a way for you to relate to them. Second, no obviously they aren't okay. Through our conversations and interviews with survivors of grief, they can't overstate how annoying and repetitious it is to hear that phrase. Lastly, no, never say that; ever. No reason in the world should exist for them to have to go through this pain.â 
â 
